def encrypt():
    out = []
    with open("bean_flag.png", 'rb') as f:
        block = f.read(16)
        while block:
            state = []
            for byte in block:
                state.append(byte)
                # Convert byte to hexadecimal and add it to the output list
                out.append(f"{byte:02x}")
            
            # After each 16 bytes, print them as a single line in hex format
            print(''.join(out[-16:]))  # print last 16 hex bytes
            
            block = f.read(16)
    return {"encrypted": ''.join(out)}

encrypt()


